import { ISortType } from "../../Model/appModel";

export const sortStore: ISortType[] = [
  {
    sortHeader: 'Insertion Sort',
    name: 'INSERTION_SORT',
    code:`public static void insertionSort(int[] arr) {
      int n = arr.length;
      for (int i = 1; i < n; i++) {
          int key = arr[i];
          int j = i - 1;
          while (j >= 0 && arr[j] > key) {
              arr[j + 1] = arr[j];
              j = j - 1;
          }
          arr[j + 1] = key;
      }
    }`
  },
  {
    sortHeader: 'Selection Sort',
    name: 'SELECTION_SORT'
  },
  {
    sortHeader: 'Bubble Sort',
    name: 'BUBBLE_SORT'
  },
  {
    sortHeader: 'Merge Sort',
    name: 'MERGE_SORT'
  },
  {
    sortHeader: 'Quick Sort',
    name: 'QUICK_SORT'
  }
];
